(4113, 36, 530, 1, '螢火', '', '2008-05-10 00:00:00', 0000, 19, 0, 7, '', '上帝給我一些時間\n讓我溫熱 讓我感覺\n讓我渴望這世界　美麗而悠遠\n\n上帝給我一些時間\n讓我呼吸　讓我沉澱\n看看這寬闊世界　美好而殘缺\n\n我因而明白　這人生短暫\n如螢火閃閃　徒勞而無害\n\n我因而明白　這人生短暫\n如螢火閃閃　徒勞而無害', 261, '', '', '', '', '', 'TWV270800801', 1, 1, 0, '2008-05-16 15:17:13', '2015-03-12 13:32:12', '0000-00-00 00:00:00'),
(4114, 36, 530, 2, '灰色', '', '2008-05-10 00:00:00', 0000, 19, 0, 7, '', '主唱：熊寶貝\n作曲：餅乾\n填詞：餅乾\n編曲：\n監製：\n歌詞\n灰色的天　灰色的邊 \n灰色是你的聲線在我耳邊\n灰色的煙　在我指尖\n纏纏繞繞都是對你的想念\n日子仍然一天天　\n人們依舊歡快　熱絡的過節\n我還時常想起從前　\n那時你牽著我　走著長街　\n走了好遠　好遠\n沉默如此曲折蜿蜒\n你的笑在我心裡睡得多甜\n日子仍然一天天\n我不敢過分掛念　怕自己迎刃而解\n我還時常想起從前　\n我總有種錯覺　以為你就在身邊\n沒有走遠　沒有走遠\n\n', 418, '', '', '', '', '', 'TWV270800802', 1, 1, 0, '2008-05-16 15:24:23', '2015-03-12 13:32:12', '0000-00-00 00:00:00'),
(4116, 99, 546, 2, 'Goodbye My Friends', '', '2008-05-25 00:00:00', 0000, 0, 1, 7, '', '別停下來　奔馳的循環\n擁抱空氣的樹　和往常一樣的緩慢\n別停下來　奔馳的循環\n不過眼前的路　還漂著灰色的塵埃\n\n我明白　等待著我的也許不只有更多更難的阻礙\n至少我們都能夠釋懷\n我明白　等待著我的也許不只有更深更暗的腐敗\nbut I''m gonna go, so goodbye my friends\n\n\n我期待　彼此擁有的 將會是那片更寬更美的海\n勝過我們認同的存在\n我明白　等待著我的也許不只有更深更暗的腐敗\nbut I''m gonna go, so goodbye my friends\n\n ', 241, '', '', '', '', '', '', 1, 1, 0, '2008-05-16 16:30:54', '2015-03-12 13:32:12', '0000-00-00 00:00:00'),
