(4325, 717, 545, 10, '負荷', '', '2008-04-23 00:00:00', 0000, 19, 0, 7, '', '原詩文：吳晟 / 改編詞：吳志寧　\n\n下班之後，便是黃昏了\n偶爾也望一望絢麗的晚霞\n卻也不再逗留\n因為你們仰向爸爸的小臉\n透露更多的期待\n\n加班之後，便是深夜了\n偶爾也望一望燦爛的星空\n卻也不再沉迷\n因為你們熟睡的小臉\n比星空更迷人\n\n阿爸每日每日的上下班\n有如陀螺的轉呀轉\n將阿爸激越的豪情\n逐一轉為柔情\n\n就像阿公和阿媽\n為阿爸織就了一生\n綿長而柔密的呵護\n孩子呀！阿爸也沒有任何怨言\n只因這是生命中\n最沉重\n也是最甜蜜的負荷\n\n最甜蜜的負荷　啦啦啦…\n', 216, '吳志寧', '', '', '', '', 'TWV270800710', 1, 1, 0, '2008-05-19 00:09:48', '2015-03-12 13:32:20', '0000-00-00 00:00:00'),
(4326, 1420, 0, 1, '交換禮物', '十個禮物換一個你，可以嗎？', '0000-00-00 00:00:00', 0000, 0, 1, 17, '交換禮物\r\n原詞：郭小優<十個禮物換一個你，可以嗎？ >\r\n改編：小雨  曲/吉他：龍\r\n\r\n每次　短暫見面　你總會帶來一個禮物\r\n一項項　收好好　圍繞著我一起生活\r\n◎\r\n這次　終於見面　你還是帶來一個禮物\r\n小心的　輕捧著　微風吹過我的心頭\r\n但卻仍有種空虛　少了你就是不行\r\n沒了熟悉的溫暖　我不要沒有擁抱的世界\r\n※\r\n可不可以　集滿十個交換一個你\r\n我真的願意丟掉那些　換你在我的身邊\r\n十天　五天　甚至是一天\r\n可不可以　集滿十個交換一個你\r\n我真的願意失去一切　換你在我的身邊\r\n十秒　五秒　就算只有一秒　交換禮物好不好\r\nrepeat ※ ◎ \r\n', '', 257, '', '王隆龍(龍)', '吳信霈(小雨)', '王隆龍(龍)', 'ღ＊§龍＠創作音慾§＊ღ', '', 0, 1, 0, '2008-05-19 03:35:09', '2015-03-12 13:32:20', '0000-00-00 00:00:00'),
